import React,{ Component } from 'react';
import axios from 'axios';
class Form1 extends Component
{
    constructor(props)
    {
        super(props)
        this.handleSubmit=this.handleSubmit.bind(this)
        this.handleChange=this.handleChange.bind(this)
        this.state={
              employeeForm:{
                  firstname:'',
                  username:'',
                  password:''
              }
        }
        console.log(this.state.employeeForm)
    }

    handleSubmit(e)
    {
       var data={firstname:this.state.firstname,username:this.state.username,password:this.state.password}
      axios.post('http://localhost:8080/api/insertstudent', data);
      console.log("helo",data);
    }
    handleChange(e)
    {   
        console.log(" data ",e.target.name," ",e.target.value)
        this.setState({
            [e.target.name]:e.target.value
        })
    }

    render(){
        return(
            <div>
             <form onSubmit={this.handleSubmit} action="/form" method="post">
                 <label> firstname
                 <input type="text" name="firstname"  
                               onChange={this.handleChange} id="firstName"/></label>
                   <br/><br/>   
                   <label> username
                 <input type="text" name="username" 
                               onChange={this.handleChange} id="username"/></label>
                    <br/><br/> 
                    <label> password
                 <input type="text" name="password" 
                               onChange={this.handleChange} id="password"/></label>

                    <br/><br/>


                 <a href='/search'>search</a>
                    <button type="submit">submit</button>           
                 </form>
            </div>
        )
    }

}
export default Form1
